import React, { Component } from 'react';
import CardMenu from '../CardMenu.js';

class MenuGallery extends Component {
  constructor(props){
    super(props);
  }

  render() {
    const { showMilkshakeMenu , showWrafflesMenu} = this.props;

    return (
      <div>
        <div className="row">
          <div className="col-6 gallery-image gallery-image-left" >
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title" onClick={() => showMilkshakeMenu()}>Milkshakes</p>
          </div>
          <div className="col-6 gallery-image gallery-image-right" onClick={() => showWrafflesMenu()}>
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title">Wraffles</p>
          </div>
        </div>

        <div className="row">
          <div className="col-12 gallery-image gallery-image-large">
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title menu-gallery-title-large">Våfflor</p>
          </div>
        </div>

        <div className="row">
          <div className="col-6 gallery-image gallery-image-left">
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title">Dryck</p>
          </div>
          <div className="col-6 gallery-image gallery-image-right">
            <img src={require('../Assets/Images/omOss.jpg')} alt="bild på personal" />
            <p className="menu-gallery-title">Bakverk</p>
          </div>
        </div>

        <CardMenu menuToShow={this.state.menuIndex} />

      </div>

      )
  }
}

export default MenuGallery;
